function keyPressed() {
  if (key == '=' || key == '+') {
    for (let i = 0; i < shapes.length; i++) {
      shapes[i].upScale();
    }
  } else if (key == '-' || key == '_') {
    for (let i = 0; i < shapes.length; i++) {
      shapes[i].downScale();
    }
  } else if (key == 'd' || key == 'D') {
    viewDiagram = !viewDiagram;
  } else if (key == ' ') {
    bColor -= 26;
    if (bColor <= 0) {
      bColor = 255;
    }
  } else if (key == 'r' || key == 'R') {
    displayRed = !displayRed;
  } else if (key == 'g' || key == 'G') {
    displayGreen = !displayGreen;
  } else if (key == 'b' || key == 'B'){
    displayBlue = !displayBlue;
  } else if (key == '1') {
    tokyoParams();
  } else if (key == '2') {
    berlinParams();
  } else if (key == '3') {
    londonParams();
  } else if (key == '4') {
    nycParams();
  } else if (key == '5') {
    cdmxParams();
  } else if (key == '6') {
    laParams();
  } else if (keyCode == UP_ARROW) {
    stillLifeDepthNeg += 26;
    stillLifeDepthPos += 26;
  } else if (keyCode == DOWN_ARROW) {
    stillLifeDepthNeg -= 26;
    stillLifeDepthPos -= 26;
  } else if (key == 's' || key == 'S') {
    speedIndex++;
    speedIndex = speedIndex % speeds.length;
    speedScalar = speeds[speedIndex];
  } else if (key == '0') {
    lengthScalar += 0.2;
  } else if (key == '9') {
    if (lengthScalar > 0.4) {
      lengthScalar -= 0.2;
    }
  } else if (key == 't' || key == 'T') {
    cIndex++;
    if (cIndex >= rezs.length) {
      cIndex = 0;
    }
    doIt();
  } else if (key == 'p' || key == 'P') {
    saveCanvas(nf(index,3) + '-' + allCombinations[index] + "-" + frameCount + ".png", 0, 0, width, height);
  }
}

class RND {
  constructor(seed) {
    this.seed = seed;
  }
  rd() {
    this.seed ^= this.seed << 13;
    this.seed ^= this.seed >> 17;
    this.seed ^= this.seed << 5;
    return ((this.seed < 0 ? ~this.seed + 1 : this.seed) % 1000) / 1000;
  }
  rb(a, b) {
    return a + (b - a) * this.rd();
  }
}

