    c10 = color(113, 77, 86);
    c11 = color(154, 100, 83);
    c12 = color(178, 100, 79);
    c13 = color(194, 100, 95);
    c14 = color(199, 95, 96);
    c15 = color(207, 91, 96);
    c16 = color(215, 87, 96);
    c17 = color(223, 82, 97);
    c18 = color(231, 77, 97);
